    render() {
        return (
            <div id="home">
                <h1 style={{paddingTop:"40vh",color:"white"}}>YOUR CLUB CARD MANAGEMENT APPLICATION</h1>
                {/* <Button style={{marginRight:"3vw",marginTop:"2vw"}}>User login</Button>
                <Button>Enterprise login</Button> */}
                <NavLink className="navLink" to="/users" >User login</NavLink>          
                <NavLink  className="navLink" to="/enterprises">Enterprise login</NavLink>
            </div>
        )
    }
}
export default Home;
